import React, { Component } from "react";
import { Container } from "reactstrap";

import ArticleShow from "./ArticleShow";

class ArticlePreview extends Component {
  render() {
    const article = this.props;
    return (
      <Container>
        {article.name}
        <br />
        {article.author}
      </Container>
    );
  }
}

export default ArticlePreview;
